import React, { Component } from "react";
import PostData from "../data/db.json";

class PostList extends Component {
  render() {
    return (
      <div>
        {PostData.cards.map((postDetails, index) => {
          return <h1>{postDetails.title}</h1>;
        })}
      </div>
    );
  }
}
export default PostList;
